import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';

@Injectable({
  providedIn: 'root'
})
export class SignupServiceService {

  constructor(private http: HttpClient) { }

  addUsert_service(uUser:string, uPass:string, uFirst: string, uLast: string, uCont: string)
  {
    this.http.post('https://localhost:3000/api/user', 
    { 
      username:uUser, 
      password:uPass,
      firstname:uFirst,
      lastname:uLast,
      contact:uCont
    })
    .subscribe(respose => {console.log(respose)})
  }
}
